script: |
  super -f text -I q12114.spq | sort > q12114.out

inputs:
  - name: q12114.spq
    data: |
      SELECT DISTINCT COUNT ( * ) FROM tab2 (FORMAT parquet) WHERE NOT - + col1 + - 59 * - ( - 32 ) / - 74 + - col2 >= 87 - - ( + col1 );
  - name: tab2

outputs:
  - name: q12114.out
    data: |
      3
